Nice. The plot is nothing special. It's very simple, trivial and predictable, but more or less, it's the cinecomic genre that is made in this way. It's always more hard to find a complex and unique plot, because cinecomics always follow a standart formula. Anyway, in general, not bad. I enjoyed it. The whole cast is fitting pretty well the characters of comics, working out on screen. Compared to the films of the MCU, this one is definitely darker and more mature for dialogues and also topics that are mentioned quite clearly, like physical, mental abuse and probably also sexual assault. In addition, the introduction of Marvel's first LGBTQ couple, protagonist in the story. There is no Villain, but the obstacle is fear itself. Through the protagonist we explore the fears of all the mutants, knowing in part their past and their emotions, related to a trauma. The real goal is not as usual, to defeat a villain but to have control of own powers and getting a balance of yourself, overcoming the fears and earning confidence, through a path of growth and freedom. Very psychological. All mutants are cool. I loved their skills, but my favorite is definitely Illyana. The most interesting and Badass in my opinion, and i hope to explore her more in the eventually next films. Anya stole the Show. Excellent special effects and great action scenes. 
Who else watched it? Did you like it? Let me know. 

